<?php
require '../db_connect.php';

// التحقق من حالة تسجيل الدخول
session_start();

if (isset($_SESSION['user_id'])) {
    $redirect_page = ($_SESSION['account_type'] === 'teacher') ? '../dashboard/teacher/main/dashboard.php' : '../dashboard/student/main/dashboard.php';
    header("Location: $redirect_page");
    exit();
}

// تهيئة مدة الجلسة لخيار تذكرني
$session_lifetime = isset($_POST['rememberMe']) ? 2592000 : 0; // 30 يوم أو مدة الجلسة الافتراضية

if (session_status() === PHP_SESSION_NONE) {
    session_set_cookie_params([
        'lifetime' => $session_lifetime,
        'path' => '/',
        'secure' => isset($_SERVER['HTTPS']) && $_SERVER['HTTPS'] === 'on',
        'httponly' => true,
        'samesite' => 'Strict'
    ]);
}

// تهيئة رمز CSRF إذا لم يتم إنشاؤه
if (empty($_SESSION['csrf_token'])) {
    $_SESSION['csrf_token'] = bin2hex(random_bytes(32));
}

$errors = [];
if ($_SERVER['REQUEST_METHOD'] === 'POST') {
    if (!isset($_POST['csrf_token']) || $_POST['csrf_token'] !== $_SESSION['csrf_token']) {
        $errors[] = "رمز CSRF غير صالح";
    } else {
        $username = trim($_POST['username']);
        $password = $_POST['password'];

        if (empty($username)) {
            $errors[] = 'يرجى إدخال اسم المستخدم.';
        }
        if (empty($password)) {
            $errors[] = 'يرجى إدخال كلمة المرور.';
        }

        if (empty($errors)) {
            $query = "SELECT * FROM users WHERE BINARY username = ?";
            if ($stmt = $conn->prepare($query)) {
                $stmt->bind_param("s", $username);
                $stmt->execute();
                $result = $stmt->get_result();

                if ($result->num_rows === 1) {
                    $user = $result->fetch_assoc();
                    if (password_verify($password, $user['password'])) {
                        session_regenerate_id(true); // إعادة إنشاء معرف الجلسة

                        $_SESSION['user_id'] = $user['id'];
                        $_SESSION['account_type'] = $user['account_type'];

                        // إدارة الكوكيز لخيار "تذكرني"
                        if ($session_lifetime > 0) {
                            setcookie(session_name(), session_id(), time() + $session_lifetime, "/", "", isset($_SERVER['HTTPS']), true);
                        }

                        $redirect_page = ($user['account_type'] === 'teacher') ? '../dashboard/teacher/main/dashboard.php' : '../dashboard/student/main/dashboard.php';
                        header("Location: $redirect_page");
                        exit();
                    } else {
                        $errors[] = 'اسم المستخدم أو كلمة المرور غير صحيحة.';
                    }
                } else {
                    $errors[] = 'هذا الحساب غير موجود.';
                }

                $stmt->close();
            } else {
                error_log("Error preparing statement: {$conn->error}");
                $errors[] = 'حدث خطأ أثناء تسجيل الدخول. يرجى المحاولة لاحقاً.';
            }
        }
    }
}
